import React from 'react';
import './views.css'
import bg from '../Images/MainBG.png'
import wave from '../Images/wave.png'
import wave1 from '../Images/wave1.png'

const Homepage = () =>{


    return(
        <div className="homepagept0">
        <img src={bg} width="100%" height="100%" alt="mountains with sun shining through" />
        <div className="homepagept1"></div>
        <img className="wave1" src={wave} width="100%" height="15%" alt="waves for adding a nice effect to the the mountains in the background" />
        <img className="wave2" src={wave1} width="100%" height="15%" alt="waves for adding a nice effect to the the mountains in the background" />
        <div className="homepagept2">
        <h2>About Me</h2>
        <p>As a psychic, I just knew and understood things that made no sense to me. And always had answers even as a child. I remember people asking me how I knew things and I would say "I just do". As wonderful as that was it meant that there was always someone wanting my help. </p>
        </div>
         </div>
    )
}

export default Homepage;
